import React from 'react';
import {NavBar} from "../NavBar";
import AddEntry from "../AddEntry";
import CurrentEntries from "../CurrentEntries";
import Footer from "../Footer";

const Home = () => {
    return (
        <div className="App">
            <h1>Entries</h1>
            <AddEntry />
            <hr />
            <CurrentEntries />
            <hr />
            <Footer />
        </div>
    );
};

export default Home;
